import React from "react";
import images from "../../assets";
import Footer from "../../components/footer";
import SearchBar from "../../components/searchBar";
import BannerSections from "./bannerSections";
import constants from "./constants";
import {
  Container,
  HeaderContainer,
  Logo,
  RentBanner,
  BannerContainer,
  BannerContainerContent,
  BannerButton,
  BannerTitle,
  BannerDescription,
  BuyBanner,
} from "./styles";

export default function Home() {
  return (
    <>
      <HeaderContainer>
        <Logo src={images.houseLogo}></Logo>
      </HeaderContainer>
      <SearchBar />
      <BannerSections
        description={constants.rentProperty.description}
        title={constants.rentProperty.title}
        button={constants.rentProperty.button}
      ></BannerSections>
      <div>slider</div>
      <Container>
        <BannerContainer>
          <BuyBanner />
          <BannerContainerContent>
            <BannerTitle>{constants.buyProperty.title}</BannerTitle>
            <BannerDescription>
              {constants.buyProperty.description}
            </BannerDescription>
            <BannerButton>{constants.buyProperty.button}</BannerButton>
          </BannerContainerContent>
        </BannerContainer>
      </Container>
      <div>slider</div>
      <Footer subtitle={"About"} title={"Carrer"}></Footer>
    </>
  );
}
